import styled from "styled-components"

const Main=styled.div`
background-color:white;
`
const Header=styled.header`
height:20%;
background-color:black;
display:flex;
flex-direction:row;
align-items:center;
justify-content:space-between;
padding:2px;
box-shadow:0 3px 6px 0 #555;
`
const AppName=styled.div`
color:white;
display:flex;
align-items:center;
img{
  width:60px;
  height:50px;
}
`
const SearchName=styled.div`
padding:5px;
background-color:white;
width:50%;
display:flex;
align-items:center;
border-radius:10px;
margin-right:10px;
img{
  width:25px;
  height:25px;
}
input{
  width:100%;
  height:50%;
  display:flex;
  align-items:center;
  border:none;
  outline:none;
  padding-left:180px;
}
`

function App() {
  return (
    <Main>
      <Header>
        <AppName>
        <img alt ="app logo" src={`../images/food.png`}/>
                <h2>Recipe Finder</h2>
        </AppName>
        <SearchName>
        <img alt ="search logo" src={`../images/search.png`}/>
               <input type="text" placeholder="search an item here"></input>
        </SearchName>
      </Header>
    </Main>
  );
}

export default App;
